import React from 'react';
// import ReactDOM from 'react-dom';
import './style.sass';


class App extends React.Component {
  render() {
    return (
      <div>
        <header></header>
        <main>
          <div class="main__left"></div>
          <div></div>
          <div></div>
        </main>
        <div class="terminal"></div>
      </div>
    );
  }
}

// ========================================

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
